INSERT INTO `lugares` (`id`, `Nombre`, `Nombre_Maya`, `Nombre_Ingles`, `Nombre_Cientifico`, `Recorrdio`, `Descripcion`, `id_categoria`) VALUES
(1, 'Trincheras', 'Cháach', 'Trench', 'Chlorophora tinctoria', '40 Minutos', 'La gruta es tipo seca, el acceso es caminando y relativamente sencillo, se accede a un salón de gran tamaño y de ahí a otra cámara de forma ovoide con altura irregular, cuenta con diversos espeleotemas agradables a la vista. También se puede encontrar vestigios mayas en su interior.', 2),
(2, 'Murciélagos', 'Sootos', 'Bat', 'Chiroptera', '30 Minutos', 'Es una gruta conformada por barro seco en donde se puede apreciar fósiles marinos, cuenta con túneles que se pueden recorrer arrastrándose, sintiendo una experiencia agradable.', 2),
(3, 'El platanal', 'Banana Plantation', 'U Ku Chi’il Yaán Paka’al Ja’as', 'Musa Paradisiaca', '2 horas', 'Se trata de una gruta donde su acceso es a rappel de 7 metros de profundidad, con caminos estrechos, ideal para la aventura extrema, se puede encontrar preciosas formaciones rocosas cristalinas, así como un esqueleto humano llamado “Anacleto”, guardián de la gruta.', 2),
(4, 'Xmait', 'IX’mait', 'Bottomless', '', '5 horas', 'Se trata de una oquedad natural de 25 metros absolutos para realizar rappel libre, tiene un recorrido de 1 km con enormes cámaras en donde se puede apreciar bonitas formaciones y cascadas reales en la temporada de lluvia, así como observar mucha evidencia maya en su interior.', 2),
(5, 'Comidas', '', '', '', '', 'Se puede disfrutar de las comidas típicas de la región las cuales son: Queso relleno, poc-chuc, pollo pibil y la tradicional cochinita enterrada', 3),
(6, 'Postres', '', '', '', '', 'Los postres tÍpicos de la región que se ofrecen: Dulce de papaya, ciruela, camote y caballero pobre.', 3),
(7, 'Bebidas', '', '', '', '', 'Las bebidas naturales que permiten mitigar la sed y que van acompañadas de las comidas son: Jugo de naranja, limonada, jamaica y horchata.', 3),
(8, 'Javier es gay', '', '', '', '', 'El panel de administración para Grutas Sartenejas brinda un control completo sobre la gestión de datos de la aplicacion movil, la creación y edición de contenido, y el análisis del rendimiento del proyecto. Esta herramienta permite administrar el proyecto de manera efectiva y garantizar que la aplicacion movil se mantenga actualizado y optimizado para brindar una experiencia excepcional a los usuarios.', 1);

